import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

import "./Mis.css";

import MisEvent from "./MisEvent";
import AddEvent from "./AddEvent";

const MisEvents = ({ mis }) => {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    const getEvents = async () => {
      const events = await fetchEvents();
      setEvents(events);
    };
    getEvents();
  }, []);

  const fetchEvents = async () => {
    // const misId = { misId: mis.id };
    const misId = { misId: "1781190e-2726-4136-aa4d-f9c55b23f4f0" };

    const response = await axios.post(
      "http://localhost:8080/get_EVENTS_by_MIS",
      misId
    );
    return response.data;
  };

  return (
    <>
      <div className="eventsList">
        <div>
          <h3 style={{ paddingTop: "20px", paddingLeft: "20px" }}>Events</h3>
          <Link to="/addEvent" className="btn btn-primary">
            Add Event
          </Link>
        </div>
        {events.length === 0 ? (
          <h1>Este Mis nao tem eventos</h1>
        ) : (
          events.map((event) => <MisEvent key={event.id} event={event} />)
        )}
      </div>
    </>
  );
};

export default MisEvents;
